   this[database_length++] = new SearchPage("misc.html", "Help & More", "        Help & More                                              Is this life? Is it real?                                  Content Dumpyard               Thursday, January 02, 2025 - The Beating heart of an A350  A350-1000 avionics bay                Hello everyone, now a video of the A350 avionics bay with a more indepth components location  Enjoy the crawl through                              Thursday, January 02, 2025 - Volvos, TikTok and Mental Health - Scotty Fairno #7               Scotty Fairno found TikTok fame through his love and Volvos, Classic Cars and fuelling his vehicles with homemade oil   Scotty had over 1 million followers on TikTok before his account was banned and removed by the platform Scotty now focuses on YouTube content   In this groundbreaking painting interview/date Rory and Scotty discuss the meaning of life, men's mental health crisis and getting drunk in Africa                               Tuesday, June 25, 2024 - Kinder Surprise Egg               Kinder surprise egg, a quite astonishing commodity The surprise of this excessive object, the cause of your desire, is here materialised in the Geist of an object which fills in the inner void of the chocolate egg The whole delicate balance is between these two dimensions  what you bought, the chocolate egg, and the surplus, probably made in some Chinese gulag or whatever, that you get for free I don't think that the chocolate frame is here just to send you on a deeper voyage towards the inner treasure, the what Plato calls the 'Agalma', which makes you a worthy person, which makes a commodity the desirable commodity I think it's the other way around We should aim at the higher goal, the gold in the middle of an object, precisely in order to be able to enjoy the surface   -Slavoj Žižek                              Sunday, June 23, 2024 - Fear of Abandonment               &quot Don't worry about being abandoned, worry about abandoning nobody.&quot   Street Therapy, Ep 2&nbsp  by Tilek                              Wednesday, June 12, 2024 - The Seven Phases of Madness               Welcome aboard the rollercoaster that is Mathieu Bélanger-Barrette's twisted mind while experiencing yet another journey on a gravel bike Mad or not mad? Yours to judge.⁠                              Sunday, June 02, 2024 - Discomfort               Your comfort zone is where your dreams go to die Always be learning Always be growing And be willing to get uncomfortable                              Thursday, May 23, 2024 - Tungsten cube cured my mortality               All the people here who bought this wireless tungsten cube to admire its surreal heft have precisely the wrong mindset I, in my exalted wisdom and unbridled ambition, bought this cube to become fully accustomed to the intensity of its density, to make its weight bearable and in fact normal to me, so that all the world around me may fade into a fluffy arena of gravitational inconsequence And it has worked, to profound success I have carried the tungsten with me, have grown attached to the downward pull of its small form, its desire to be one with the floor This force has become so normal to me that lifting any other object now feels like lifting cotton candy, or a fluffy pillow Big burly manly men who pump iron now seem to me as little children who raise mere aluminum    I can hardly remember the days before I became a man of tungsten How distant those days seem now, how burdened by the apparent heaviness of everyday objects I laugh at the philistines who still operate in a world devoid of tungsten, their shoulders thin and unempowered by the experience of bearing tungsten Ha, what fools, blissful in their ignorance, anesthetized by their lack of meaningful struggle, devoid of passion    Nietzsche once said that a man who has a why can bear almost any how But a man who has a tungsten cube can bear any object less dense, and all this talk of why and how becomes unnecessary    Schopenhauer once said that every man takes the limits of his own field of vision for the limits of the world Tungsten expands the limits of a man’s field of vision by showing him an example of increased density, in comparison to which the everyday objects to which he was formerly accustomed gain a light and airy quality Who can lament the tragedy of life, when surrounded by such lightweight objects? Who can cry in a world of styrofoam and cushions?    Have you yet understood? This is no ordinary metal In this metal is the alchemical potential to transform your world, by transforming your expectations Those who have not yet held the cube in their hands and mouths will not understand, for they still live in a world of normal density, like Plato’s cave dwellers Those who have opened their mind to the density of tungsten will shift their expectations of weight and density accordingly    To give this cube a rating of anything less than five stars would be to condemn life itself Who am I, as a mere mortal, to judge the most compact of all affordable materials? No I say gratefully to whichever grand being may have created this universe  good job on the tungsten It sure is dense    I sit here with my tungsten cube, transcendent above death itself For insofar as this tungsten cube will last forever, I am in the presence of immortality                                Wednesday, May 22, 2024 - Industrial Society and Its Future               &quot We give up a piece of ourselves whenever we adjust to conform to society's standards That, and we're too plugged in We're letting technology take over our lives, willingly.&quot   - Ted Kaczynski, The Unabomber                                Monday, May 20, 2024 - Previous homepage intro  I own a musket for home defense               I own a musket for home defense, since that's what the founding fathers intended Four ruffians break into my house &quot What the devil?&quot  As I grab my powdered wig and Kentucky rifle Blow a golf ball sized hole through the first man, he's dead on the spot Draw my pistol on the second man, miss him entirely because it's smoothbore and nails the neighbors dog I have to resort to the cannon mounted at the top of the stairs loaded with grape shot, &quot Tally ho lads&quot  the grape shot shreds two men in the blast, the sound and extra shrapnel set off car alarms Fix bayonet and charge the last terrified rapscallion He bleeds out waiting on the police to arrive since triangular bayonet wounds are impossible to stitch up Just as the founding fathers intended                              Sunday, May 19, 2024 - Jordan Peterson on Slaying the Dragon                This is the first Big Ideas Lecture performed by Jordan Peterson, back in 2002 He reads a book for very young children by Jack Kent called &quot There's no Such Thing as a Dragon&quot  to a group of University of Toronto alumni  most over 65  He explains what it means  Pay attention -- or else                              Sunday, May 19, 2024 - Bryan Kearney & Plumb - All Over Again               I call your name  You turn around  And surrender  You feel the light on your face   No more darkness  You are home now  Take my hand look in my eyes  You can trust in me tonight  You can trust me  And you can hear my still small voice,  saying I love you, you're forgiven, and you are mine  You are mine  I will leave  I will leave the 99  I will suffer out of love and I would die  I will sacrifice  All over again for you  I am reckless for your heart  Let me feel, let me heal the deepest part  Again, and again and again   All over again for you                                 Submit quotes, your favourite YT video links and other quality content here                                   ", "");
